  `img` varchar(255) NOT NULL COMMENT '图片',
  `url` varchar(255) DEFAULT '' COMMENT '图片链接地址',
  `adminid` int(11) unsigned NOT NULL COMMENT '操作员ID',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `endtime` int(11) unsigned DEFAULT '0' COMMENT '编辑时间',
