/*Table structure for table `auto_robot` */

DROP TABLE IF EXISTS `auto_robot`;

CREATE TABLE `auto_robot` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `buy_user_id` int(11) NOT NULL DEFAULT '0' COMMENT '买方user_id',
  `sell_user_id` int(11) NOT NULL DEFAULT '0' COMMENT '卖方user_id',
  `currency_id` int(11) NOT NULL DEFAULT '0' COMMENT '币种id',
  `legal_id` int(11) NOT NULL DEFAULT '0' COMMENT '法币id',
  `init_price` decimal(20,5) DEFAULT '0.00000' COMMENT '初始价格;机器人首先按照获取的行情计算，但是系统初始化时没有行情，所以需要人为设定一个初始价格（无行情时取此价格）。',
  `min_price` decimal(20,5) NOT NULL DEFAULT '0.00000' COMMENT '最小价格。该机器人下单的最小价格，如果低于该价格则触发反转（根据设置），若无反转则按该最小价格一直下单。',
  `max_price` decimal(20,5) NOT NULL DEFAULT '0.00000' COMMENT '最大价格，该机器人下单的最大价格，如果超过该价格则触发反转（根据设置），若无反转则按该最大价格一直下单。',
  `up_weight` int(10) DEFAULT '0' COMMENT '涨幅权重;和跌幅权重的总值不得大于10，目的是设定机器人的涨跌趋势，当其设定为8时，及下次价格的计算有80%的概率的涨。',
  `down_weight` int(10) DEFAULT '0' COMMENT '跌幅权重;和涨幅权重的总值不得大于10，目的是设定机器人的涨跌趋势，当其设定为8时，及下次价格的计算有80%的概率的跌。',
  `up_price` decimal(20,5) DEFAULT '0.00000' COMMENT '每次涨跌最小价格;根据涨幅权重计算所得，每次下单涨跌最小价格。',
  `down_price` decimal(20,5) DEFAULT '0.00000' COMMENT '每次跌最大价格;根据跌幅权重计算所得，每次下单涨跌的最大价格。',
  `min_number` decimal(20,5) NOT NULL DEFAULT '0.00000' COMMENT '数量随机下限；每次订单随机的交易币枚数下限。',
  `max_number` decimal(20,5) NOT NULL DEFAULT '0.00000' COMMENT '数量随机上限；每次订单随机的交易币枚数上限',
  `price_precision` int(5) DEFAULT '0' COMMENT '价格精度;计算出的价格保留的小数点位数（最好和交易对一致）。',
  `num_precision` int(5) DEFAULT '0' COMMENT '数量精度;随机的交易币枚数保留的小数点位数（最好和交易对一致）',
  `min_need_second` int(11) DEFAULT '0' COMMENT '最小下单频率;机器人每两次下单最少间隔秒数(不得大于最大下单频率;最小频率为10)。',
  `max_need_second` int(11) DEFAULT '0' COMMENT '最大下单频率;机器人每两次下单最大间隔秒数(不得小于最小下单频率)。',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `is_start` tinyint(3) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

