/*Table structure for table `bags_log` */

DROP TABLE IF EXISTS `bags_log`;

CREATE TABLE `bags_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT '0' COMMENT 'User Id',
  `type` varchar(255) DEFAULT '0' COMMENT '类型：',
  `money` decimal(20,6) DEFAULT '0.000000' COMMENT '金额',
  `before` decimal(20,6) DEFAULT '0.000000' COMMENT '变动前',
  `content` text COMMENT '说明',
  `extends` text CHARACTER SET utf8mb4,
  `create_time` int(11) DEFAULT '0',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '1充值 2提现 3内部转出 4内部转入 5推荐所得 6冻结usdt释放 7矿机本金 8矿池支付 9矿池返还 10交易支付 11交易所得 12后台调整 13 撤单返还 14股东分红 15持币生息',
  `orderId` int(11) DEFAULT '0' COMMENT '订单号',
  `fromid` int(11) DEFAULT '0',
  `state` tinyint(3) NOT NULL DEFAULT '0' COMMENT '0未结算1已结算',
  `sl_num` decimal(10,4) DEFAULT '0.0000' COMMENT '算力数量',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=427 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

