/*Table structure for table `coininto` */

DROP TABLE IF EXISTS `coininto`;

CREATE TABLE `coininto` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `username` varchar(200) DEFAULT NULL,
  `address` varchar(600) DEFAULT NULL,
  `fromusername` varchar(200) DEFAULT NULL,
  `coinname` varchar(50) DEFAULT NULL,
  `txid` varchar(100) DEFAULT NULL,
  `is_release` tinyint(2) DEFAULT '0',
  `is_fee` tinyint(2) DEFAULT '0',
  `num` decimal(15,5) DEFAULT NULL,
  `addtime` int(100) DEFAULT NULL,
  `status` tinyint(2) DEFAULT NULL,
  `fee_hash` varchar(100) DEFAULT NULL COMMENT '旷工费哈希',
  `fee_gas_price` varchar(100) DEFAULT '0',
  `is_pending` tinyint(3) NOT NULL DEFAULT '0',
  `release_num` varchar(100) NOT NULL DEFAULT '0',
  `release_hash` varchar(500) DEFAULT NULL COMMENT '转账哈希',
  `mum` decimal(20,11) DEFAULT NULL COMMENT '数值',
  `type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '1:usdt 2:lxc',
  `gj_time` int(11) NOT NULL DEFAULT '0' COMMENT '归集时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

