/*Table structure for table `es_article` */

DROP TABLE IF EXISTS `es_article`;

CREATE TABLE `es_article` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '文章内容ID',
  `title` varchar(255) NOT NULL COMMENT '文章标题',
  `content` text NOT NULL COMMENT '文章内容',
  `img` varchar(255) DEFAULT NULL COMMENT '文章图片',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `endtime` int(11) unsigned DEFAULT '0' COMMENT '编辑时间',
  `type` varchar(200) DEFAULT NULL COMMENT '文章类型',
  `status` tinyint(4) unsigned DEFAULT '1' COMMENT '不同的状态值代表不同的操作 0:冻结中 1:正常',
  `adminid` int(11) unsigned DEFAULT NULL COMMENT '发布人的ID',
  PRIMARY KEY (`id`),
  KEY `adminid` (`adminid`) USING BTREE
