/*Table structure for table `es_leave` */

DROP TABLE IF EXISTS `es_leave`;

CREATE TABLE `es_leave` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT '0' COMMENT '用户id',
