/*Table structure for table `store_member` */

DROP TABLE IF EXISTS `store_member`;

CREATE TABLE `store_member` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `email` varchar(255) NOT NULL DEFAULT '0' COMMENT '邮箱',
  `wx_token` varchar(255) DEFAULT NULL,
  `invite_code` char(6) DEFAULT '0' COMMENT '推荐码',
  `num_id` int(11) DEFAULT '0' COMMENT '会员id编码',
  `openid` varchar(100) DEFAULT '' COMMENT '会员微信OPENID',
  `phone` varchar(16) DEFAULT '' COMMENT '会员手机号',
  `password` varchar(64) NOT NULL DEFAULT '' COMMENT '登录密码',
  `paypassword` varchar(64) DEFAULT NULL COMMENT '支付密码',
  `nickname` varchar(20) DEFAULT '' COMMENT '会员昵称',
  `headimg` varchar(500) DEFAULT '' COMMENT '会员头像',
  `sex` char(2) DEFAULT '3' COMMENT '性别',
  `level` tinyint(2) unsigned DEFAULT '0' COMMENT '会员级别0用户1会员2节点3董事4联创5动态股东6预备节点',
  `region_level` int(11) DEFAULT '0' COMMENT '区域等级',
  `remark` varchar(500) DEFAULT '' COMMENT '会员个性签名',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '会员状态(1有效,0无效)',
  `isjh` tinyint(3) unsigned DEFAULT '1' COMMENT '0未激活1已激活',
  `create_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_jh` int(11) DEFAULT '0' COMMENT '激活时间',
  `first_leader` int(11) NOT NULL DEFAULT '0',
  `second_leader` int(11) NOT NULL DEFAULT '0',
  `third_leader` int(11) NOT NULL DEFAULT '0',
  `four_leader` int(11) NOT NULL DEFAULT '0',
  `five_leader` int(11) NOT NULL DEFAULT '0',
  `all_leader` text,
  `member_level` int(11) NOT NULL DEFAULT '1' COMMENT '对应sys_level表的中id',
  `account_money` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT 'usdt币',
  `account_score` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '矿池foc',
  `account_foc` decimal(20,6) NOT NULL DEFAULT '0.000000' COMMENT '交易foc',
  `addr_id` int(11) DEFAULT '0',
  `qrcode` varchar(255) DEFAULT NULL COMMENT '推广二维码路径',
  `is_disable` tinyint(3) NOT NULL DEFAULT '1' COMMENT '-1 禁用  1正常',
  `integral` decimal(10,4) DEFAULT '0.0000',
  `shouyi_money` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '挖矿收益',
  `tj_num` int(11) NOT NULL DEFAULT '0' COMMENT '直推人数(激活)',
  `xy_tj_num` int(11) DEFAULT '0' COMMENT '直推有效会员',
  `td_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '团队人数（全部）',
  `team_performance` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '团队业绩',
  `qukuai_img` varchar(255) NOT NULL DEFAULT '0' COMMENT '内部转账（形成的收款二维码）',
  `total_performance` double(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '总业绩(个人)',
  `address` varchar(255) NOT NULL DEFAULT '0' COMMENT 'usdt地址',
  `private` varchar(255) NOT NULL DEFAULT '0' COMMENT 'usdt秘钥',
  `usdt_online_img` varchar(255) NOT NULL DEFAULT '0' COMMENT '线上充值usdt图片路径',
  `lxc_online_img` varchar(255) DEFAULT NULL COMMENT '线上充值lxc图片路径',
  `lxcaddress` varchar(255) DEFAULT NULL COMMENT 'lxc地址',
  `lxcprivate` varchar(255) DEFAULT NULL,
  `wallet_one` decimal(10,4) DEFAULT '0.0000' COMMENT '算力(购买pos的算力)',
  `dongjie` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1冻结0正常',
  `gz_time` int(11) DEFAULT '0' COMMENT '共振额度过期时间',
  `gz_foc` decimal(10,4) DEFAULT '0.0000' COMMENT '共振额度',
  `usdt_suo` decimal(10,4) DEFAULT '0.0000' COMMENT '冻结usdt',
  `wallet_six` decimal(10,4) DEFAULT '0.0000' COMMENT '有效矿机数',
  `is_yx` tinyint(3) DEFAULT '0' COMMENT '有效会员0否1是',
  `google_state` tinyint(3) DEFAULT '0' COMMENT '谷歌验证0未验证1已验证',
  `google_secret` varchar(50) DEFAULT NULL COMMENT '谷歌秘钥',
  `google_url` varchar(255) DEFAULT NULL,
  `qrcode1` varchar(255) DEFAULT NULL COMMENT '电脑用的推广链接',
  `zhujici` text NOT NULL COMMENT '助记词',
  `is_zhujici` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1未认证 2已认证',
  `is_renzheng` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1未认证 2已认证',
  `suocang_num` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '锁仓金额',
  `suocang_fafang` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '锁仓已发放',
  `is_xiaoshou` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1未发 2已发',
  `is_shengou` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1没资格 2有资格',
  `shengou_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `index_store_member_phone` (`phone`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=380 DEFAULT CHARSET=utf8 COMMENT='商城会员信息';

