/*Table structure for table `store_member_address` */

DROP TABLE IF EXISTS `store_member_address`;

CREATE TABLE `store_member_address` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `mid` bigint(20) unsigned DEFAULT '0' COMMENT '会员ID',
  `username` varchar(20) DEFAULT '' COMMENT '收货人姓名',
  `phone` varchar(16) DEFAULT '' COMMENT '收货手机号',
  `province` varchar(50) DEFAULT '' COMMENT '收货地址省份',
  `city` varchar(50) DEFAULT '' COMMENT '收货地址城市',
  `area` varchar(255) DEFAULT '' COMMENT '收货地址区域',
  `address` varchar(255) DEFAULT '' COMMENT '收货详细地址',
  `status` tinyint(1) unsigned DEFAULT '1' COMMENT '状态(0无效, 1新快递)',
  `is_default` tinyint(1) unsigned DEFAULT '1' COMMENT '默认收货地址',
  `is_deleted` bigint(1) unsigned DEFAULT '0' COMMENT '删除状态(1删除,0未删除)',
  `create_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商城会员收货地址';

/*Data for the table `store_member_address` */

/*Table structure for table `store_member_bank` */

DROP TABLE IF EXISTS `store_member_bank`;

CREATE TABLE `store_member_bank` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL,
  `truename` varchar(255) DEFAULT NULL COMMENT '真实姓名',
  `bankname` varchar(255) DEFAULT NULL COMMENT '银行名称',
  `bankcard` varchar(255) DEFAULT NULL COMMENT '银行卡号',
  `banksite` varchar(255) DEFAULT NULL COMMENT '开户地址',
  `addtime` varchar(255) DEFAULT NULL,
  `status` int(11) DEFAULT '0' COMMENT '0 为启用  1 关闭',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `store_member_bank` */

/*Table structure for table `store_member_idcard` */

DROP TABLE IF EXISTS `store_member_idcard`;

CREATE TABLE `store_member_idcard` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL,
  `truename` varchar(255) DEFAULT NULL COMMENT '真实姓名',
  `idcard` varchar(255) DEFAULT NULL COMMENT '身份证号',
  `zidcardimg` varchar(255) DEFAULT NULL COMMENT '正面身份证图片',
  `fidcardimg` varchar(255) DEFAULT NULL COMMENT '反面身份证图片',
  `sidcardimg` varchar(255) DEFAULT '0' COMMENT '手持身份证图片',
  `addtime` varchar(255) DEFAULT NULL COMMENT '实名认证绑定时间',
  `status` int(11) DEFAULT NULL COMMENT '0为未审核 1为审核通过  2为驳回',
  PRIMARY KEY (`id`)
