/*Table structure for table `store_member_payment` */

DROP TABLE IF EXISTS `store_member_payment`;

CREATE TABLE `store_member_payment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL,
  `payment` varchar(255) DEFAULT NULL,
  `paymentimg` varchar(255) DEFAULT NULL,
  `type` int(11) DEFAULT NULL COMMENT '1 为微信 2 为支付宝3区块地址',
  `addtime` varchar(255) DEFAULT NULL,
