/*Table structure for table `store_order` */

DROP TABLE IF EXISTS `store_order`;

CREATE TABLE `store_order` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '订单类型（1为转入 2 为转出）',
  `mid` bigint(20) unsigned DEFAULT '0' COMMENT '会员ID',
  `order_no` char(20) NOT NULL DEFAULT '' COMMENT '订单号',
  `status` bigint(1) unsigned NOT NULL DEFAULT '1' COMMENT '订单状态（1还在挖矿中  2 取消挖矿了）',
  `create_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `real_price` decimal(10,4) NOT NULL,
  `up_time` date NOT NULL,
  PRIMARY KEY (`id`),
  KEY `index_store_order_order_no` (`order_no`) USING BTREE,
  KEY `index_store_order_status` (`status`) USING BTREE,
  KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商城订单主表';

/*Data for the table `store_order` */

/*Table structure for table `store_order_c2c` */

DROP TABLE IF EXISTS `store_order_c2c`;

CREATE TABLE `store_order_c2c` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '订单类型（1为转入 2 为转出）',
  `mid` bigint(20) unsigned DEFAULT '0' COMMENT '会员ID',
  `interval_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联interval表中的id',
  `order_no` char(20) NOT NULL DEFAULT '' COMMENT '订单号',
  `num` int(11) NOT NULL DEFAULT '0',
  `real_price` decimal(20,2) unsigned DEFAULT '0.00' COMMENT '金额',
  `status` bigint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1 等待中 2 匹配,确认打款中 3 完成 4 已打款 5已取消的订单6已投诉',
  `create_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `other_order_id` int(11) DEFAULT '0',
  `dakuan_image` varchar(255) DEFAULT NULL,
  `end_time` int(11) DEFAULT '0',
  `price` decimal(10,4) DEFAULT NULL,
  `cs_reason` varchar(255) DEFAULT NULL COMMENT '超时原因',
  `ism` tinyint(3) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `index_store_order_order_no` (`order_no`) USING BTREE,
  KEY `index_store_order_status` (`status`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='商城订单主表';

