/*Table structure for table `store_order_interval` */

DROP TABLE IF EXISTS `store_order_interval`;

CREATE TABLE `store_order_interval` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '订单类型（1为转入 2 为转出）',
  `title` varchar(100) NOT NULL,
  `min_value` int(11) DEFAULT '0' COMMENT '订单号',
  `max_value` int(11) unsigned DEFAULT '0' COMMENT '金额',
  `create_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `index_store_order_order_no` (`min_value`) USING BTREE
