/*Table structure for table `ty_buylist` */

DROP TABLE IF EXISTS `ty_buylist`;

CREATE TABLE `ty_buylist` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ordersn` varchar(255) DEFAULT NULL,
  `uid` int(11) DEFAULT '0',
  `uname` varchar(255) DEFAULT '0',
  `totalnum` decimal(10,2) DEFAULT '0.00' COMMENT '购买总数量',
  `leavenum` decimal(10,2) DEFAULT '0.00' COMMENT '剩余数量',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '价格',
  `addtime` int(11) DEFAULT '0',
  `matchtime1` int(11) DEFAULT '0' COMMENT '第一次匹配时间',
  `confirmtime1` int(11) DEFAULT '0' COMMENT '第一次确认时间',
  `endtime` int(11) DEFAULT '0' COMMENT '结束时间',
  `state` tinyint(3) DEFAULT '1' COMMENT '1待首次匹配2预匹配3疑问单4匹配中5匹配完成6撤回7禁止匹配',
  `type` tinyint(3) DEFAULT '0' COMMENT '1第一期2第二期',
  `pdnum` varchar(20) DEFAULT '0' COMMENT '排单次数',
  `send_bjsy` tinyint(3) DEFAULT '0' COMMENT '1未发放本金和收益2已发放本金和收益',
  `send_sy_money` decimal(10,2) DEFAULT '0.00' COMMENT '发放收益',
  `send_time` int(11) DEFAULT '0' COMMENT '本金和收益发放时间',
  `trading_status` tinyint(3) DEFAULT '0' COMMENT '前端区分0为买单1为卖单',
  `sfday_state` tinyint(3) DEFAULT '0' COMMENT '0按照级别释放天使1按照修改的天数进行释放',
  `sfday` int(11) NOT NULL DEFAULT '0' COMMENT '释放天数',
  `nac_num` int(11) DEFAULT '0' COMMENT 'nac数量',
  `sl_num` decimal(10,2) DEFAULT '0.00' COMMENT '挖矿算力',
  `sy_num` decimal(10,2) DEFAULT '0.00' COMMENT '收益数量',
  `is_topping` tinyint(3) DEFAULT '0' COMMENT '置顶状态：0否1是',
  `match_again` tinyint(3) DEFAULT '0' COMMENT '等待再次匹配：0否1是',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

