/*Table structure for table `ty_match` */

DROP TABLE IF EXISTS `ty_match`;

CREATE TABLE `ty_match` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ordersn` varchar(50) DEFAULT '' COMMENT '匹配单号',
  `b_id` int(11) DEFAULT '0' COMMENT '购买表ID',
  `s_id` int(11) DEFAULT '0' COMMENT '出售表ID',
  `b_uid` int(11) DEFAULT '0' COMMENT '购买人id',
  `b_uname` varchar(50) DEFAULT NULL,
  `s_uid` int(11) DEFAULT '0' COMMENT '出售人id',
  `s_uname` varchar(50) DEFAULT NULL,
  `num` decimal(10,2) DEFAULT '0.00' COMMENT '匹配数量',
  `hbrate` int(11) DEFAULT '0' COMMENT '红包比率',
  `hbmoney` decimal(10,2) DEFAULT '0.00' COMMENT '红包总奖励',
  `jfmoney` decimal(10,2) DEFAULT '0.00' COMMENT '转换的积分',
  `state` tinyint(3) DEFAULT '0' COMMENT '0已经匹配1已经打款2已经收款3成功完成4未打款冻结5未收款冻结6后台处理7预匹配8投诉订单9已撤销',
  `type` tinyint(3) DEFAULT '0' COMMENT '1自动2手动',
  `shunxu` tinyint(3) DEFAULT '0' COMMENT '1购买订单前期2购买订单后期',
  `paytype` tinyint(3) DEFAULT '0' COMMENT '1微信2支付宝3银行卡',
  `is_first` tinyint(3) DEFAULT '0' COMMENT '0正常1一期匹配',
  `remark` varchar(255) DEFAULT '0' COMMENT '备注',
  `payimg` varchar(255) DEFAULT NULL COMMENT '支付路径',
  `begintime` int(11) DEFAULT '0' COMMENT '购买时间',
  `addtime` int(11) DEFAULT '0' COMMENT '匹配时间',
  `addtime1` int(11) DEFAULT '0' COMMENT '打款时间',
  `addtime2` int(11) DEFAULT '0' COMMENT '收款时间',
  `addtime3` int(11) DEFAULT '0' COMMENT '成功完成时间',
  `addtime4` int(11) DEFAULT '0' COMMENT '未打款时间',
  `addtime5` int(11) DEFAULT '0' COMMENT '未确认时间',
  `addtime6` int(11) DEFAULT '0' COMMENT '后台处理时间',
  `addtime7` int(11) DEFAULT '0' COMMENT '预匹配时间',
  `cs_state` tinyint(3) DEFAULT '0' COMMENT '0未超时有奖励1已超时无奖励',
  `payment` varchar(255) DEFAULT NULL COMMENT '打款地址',
  PRIMARY KEY (`id`)
